GAZETA ZYRTARE E REPUBLIKËS SË KOSOVËS / AKTET E KONSOLIDUARA, 2024 
TEKSTI I SPASTRUAR I KUSHTETUTËS NUK PARAQET VERSIONIN ZYRTAR 



6  
Ne, Populli i Kosovës, 


Të vendosur për të ndërtuar një ardhmëri të Kosovës si një vend i lirë, demokratik  
dhe paqedashës, i cili do të jetë atdhe i të gjithë qytetarëve të vet; 

Të përkushtuar për krijimin e një shteti të qytetarëve të ba rabartë, i cili do të  
garantojë të drejtat e secilit qytetar, liritë qytetare dhe barazinë e të gjithë 
qytetarëve para ligjit; 

Të zotuar që Kosova të jetë shtet i mirëqenies ekonomike dhe i prosperitetit social; 


Të sigurt që shteti i Kosovës do të kontribuojë në stabilitetin e rajonit dhe të mbarë 
Evropës, duke krijuar marrëdhënie të fqinjësisë dhe të bashkëpunimit të mirë me të 
gjitha shtetet fqinje; 

Të bindur që shteti  i Kosovës do të  jetë anëtar i denjë i familjes së shteteve  
paqedashëse në Botë; 

Me synimin që shteti i Kosovës të përfshihet në proceset integruese Euro-Atlantike; 
Në mënyrë solemne, miratojmë Kushtetutën e Republikës së Kosovës.

GAZETA ZYRTARE E REPUBLIKËS SË KOSOVËS / AKTET E KONSOLIDUARA, 2024 
TEKSTI I SPASTRUAR I KUSHTETUTËS NUK PARAQET VERSIONIN ZYRTAR 



22  
Neni 59 
[Të Drejtat e Komuniteteve dhe Pjesëtarëve të Tyre] 

Pjesëtarët e komuniteteve kanë të drejtë që, në mënyrë individuale ose si komunitet: 

(1) të shprehin, mbajnë dhe zhvillojnë kulturën e tyre dhe të ruajnë elementet thelbësore  të 
identitetit të tyre, përkatësisht fenë, gjuhën, traditat dhe kulturën e tyre; 

(2) të marrin arsimim publik në të gjitha nivelet, në njërën nga gjuhët zyrtare të Republikës se 
Kosovës, sipas zgjidhjes së tyre; 

(3) të marrin arsimim publik parafillor, fillor dhe të mesëm, në gjuhën e tyre,  deri në  masën e 
përcaktuar me ligj, ku pragu për themelimin e paraleleve a shkollave të  veçanta për këtë qëllim, 
do të jetë më i ulët sesa ai që përcaktohet rëndom për institucionet arsimore; 

(4) të themelojnë dhe të menaxhojnë institucionet private të arsim it dhe trajnimit, për të  cilat mund 
të jepet ndihma financiare publike, në pajtim me ligjin dhe standardet  ndërkombëtare; 

(5) të përdorin gjuhën dhe alfabetin e tyre lirisht në jetën private dhe publike; 

(6) të përdorin gjuhën dhe alfabetin e tyre në marrëdhëniet e tyre me autoritetet komunale ose me 
zyrat lokale të autoriteteve qendrore në fushat në të cilat ata  përfaqësojnë një pjesë të 
mjaftueshme të popullatës, në pajtim me ligjin. Shpenzimet e bëra për interpretuesit ose 
përkthyesit, do të mbulohen nga autoritetet kompetente; 

(7) të përdorin dhe të shfaqin simbolet e komunitetit, në pajtim me ligjin dhe standardet  
ndërkombëtare; 

(8) të regjistrojnë emrat personal në formën e tyre origjinale dhe në shkrimin e gjuhës së tyre, si 
dhe emrat e tyre t’i kthejnë në formën origjinale, nëse u janë ndryshuar me dhunë; 

(9) të kenë emërtime lokale, emërtime të rrugëve dhe tregues të tjerë topografikë, që  pasqyrojnë 
dhe janë të ndjeshëm ndaj karakterit shumetnik dhe shumëgjuhësor të zonës përkatëse; 

(10) të kenë qasje të garantuar dhe përfaqësim të veçantë në mediet transmetuese publike  si dhe 
programet në gjuhën e tyre, në pajtim me ligjin dhe standardet ndërkombëtare; 

(11) të krijojnë dhe të përdorin mediet e tyre vetjake, përfshirë këtu ofrimin e informacioneve në 
gjuhën e tyre, ndër të tjera, përmes gazetave ditore e shërbimeve kabllore, dhe përdorimin e një 
numri të rezervuar të frekuencave për mediet elektronike, në pajtim me ligjin dhe standardet 
ndërkombëtare. Republika e Kosovës do të marrë të gjitha masat e nevojshme për sigurimin e 
një plani ndërkombëtar të frekuencave, për t’i mundësuar komunitetit Serb në Kosovë qasje  në 
një kanal televiziv të pavarur, të licencuar në gjuhën Serbe, në mbarë Republikën  e Kosovës; 

(12) të gëzojnë kontakte të papenguara ndërmjet tyre përbrenda Republikë s së Kosovës,  dhe të 
themelojnë e të mbajnë kontakte të lira dhe paqësore me personat në cilindo  shtet, sidomos me 
ata që kanë të përbashkët identitetin etnik, kulturor, gjuhësor a  fetar, ose trashëgiminë e 
përbashkët kulturore, në pajtim me ligjin dhe standardet ndërkombëtare; 

(13) të gëzojnë kontakte të papenguara me dhe të marrin pjesë, pa diskriminim, në  aktivitetet e 
organizatave joqeveritare lokale, rajonale dhe ndërkombëtare; 

(14) të themelojnë shoqata të kulturës, artit, shkencës dhe arsimit, si dhe shoqata  të studiuesve e 
shoqata të tjera për shprehjen, avancimin dhe zhvillimin e identitetit të tyre.

