(6) dënohet me vendim gjyqësor të formës së prerë për vepër penale me një ose më shumë 
vjet burgim; 

(7) ajo/ai vdes. 
4. Vendet e liruara të deputetëve në Kuvend, plotësohen menjëherë, në pajtim me këtë Kushtetutë dhe 
me ligjin. 

Neni 71 
[Kualifikimet dhe Barazia Gjinore] 

1. Secili shtetas i Republikës së Kosovës i cili është tetëmbëdhjetë (18) vjeç ose më i madh dhe 
përmbush kriteret ligjore, mund të jetë kandidat për deputet. 

2. Përbërja e Kuvendit të Kosovës do të respektoj parimet e barazisë gjinore të cilat janë të pranuara 
në pajtim me parimet ndërkombëtare. 

Neni 72 
[Papajtueshmëria] 

Deputeti i Kuvendit të Kosovës nuk mund të mbajë ndonjë post ekzekutiv në administratën  publike ose në 
ndonjë ndërmarrje në pronësi publike, dhe as të ushtrojë ndonjë funksion tjetër  ekzekutiv, sikurse është 
përcaktuar me ligj. 

Neni 73 
[Pamundësia e Kandidimit] 

1. Nuk mund të  kandidohen dhe as  të zgjidhen deputetë të Kuvendit, pa hequr dorë  paraprakisht nga 
detyra e tyre: 

(1) gjyqtarët dhe prokurorët; 

(2) pjesëtarët e Forcës së Sigurisë të Kosovës; 

(3) pjesëtarët e Policisë së Kosovës; 

(4) pjesëtarët e Doganave të Kosovës; 

(5) pjesëtarët e Agjencisë së Kosovës për Inteligjencë; 

(6) udhëheqësit e agjencive të pavarura;

