KAPITULLI V 
PRESIDENTI I REPUBLIKËS SË KOSOVËS 

Neni 83 
[Statusi i Presidentit] 

Presidenti është kreu i shtetit dhe përfaqëson unitetin e popullit të Republikë së Kosovës. 

Neni 84 
[Kompetencat e Presidentit] 

Presidenti i Republikës së Kosovës: 

(1) përfaqëson Republikën e Kosovës brenda dhe jashtë; 

(2) garanton funksionimin kushtetues të institucioneve të përcaktuara me këtë Kushtetutë; 

(3) shpall zgjedhjet për Kuvendin e Kosovës dhe thërret mbledhjen e parë te tij; 

(4) nxjerr dekrete në pajtim me këtë Kushtetutë; 

(5) shpall ligjet e miratuara nga Kuvendi i Republikës së Kosovës; 

(6) ka të drejtën e kthimit për rishqyrtim të ligjeve të miratuara, nëse konsideron se janë të 
dëmshme për int eresat legjitime të Republikës së Kosovës ose të një a më shumë  
komuniteteve të saj. Të drejtën e rikthimit të një ligji mund ta shfrytëzojë vetëm një  herë; 

(7) nënshkruan marrëveshjet ndërkombëtare në pajtim me këtë Kushtetutë; 

(8) propozon amendamente për këtë Kushtetutë; 

(9) mund të referojë çështje kushtetuese në Gjykatën Kushtetuese; 

(10) udhëheq politikën e jashtme të vendit; 

(11) pranon letrat kredenciale të shefave të misioneve diplomatike të akredituar në Republikën e 
Kosovës; 

(12) është Komandant Suprem i Forcave të Sigurisë të Kosovës; 

(13) udhëheq Këshillin Konsultativ për Komunitete; 

(14) cakton mandatarin për formimin e Qeverisë, pas propozimit të partisë politike ose të  koalicionit, 
që përbën shumicën e Kuvendit; 

(15) emëron dhe shkarkon Kryetarin e Gjykatës Supreme të Kosovës me propozimin e Këshillit 
Gjyqësor të Kosovës; 

(16) emëron dhe shkarkon gjyqtarët e Republikës së Kosovës me propozimin e Këshillit 
Gjyqësor të Kosovës; 

(17) emëron dhe shkarkon Kryeprokurorin e Shtetit të Republikës së Kosovës, me propozimin e 
Këshillit Prokuroial të Kosovës; 

(18) emëron dhe shkarkon prokurorët e Republikës së Kosovës, me propozimin të Këshillit

