(24) vendos për formimin e misioneve diplomatike e konsullore të Republikës së Kosovës, në bazë 
të konsultimit me Kryeministrin; 

(25) emëron dhe shkarkon shefat e misioneve diplomatike të Republikës së Kosovës, me 
propozimin e Qeverisë; 

(26) emëron Kryetarin e Komisionit Qendror të Zgjedhjeve; 

(27) emëron Guvernatorin e Bankës Qendrore të Republikës së Kosovës i cili shërben  edhe 
si Drejtor Menaxhues dhe emëron anëtarët e tjerë të Bordit të Bankës; 

(28) jep medalje, mirënjohje dhe çmime, në pajtim me ligjin; 

(29) shpall falje individuale, në pajtim me ligjin; 

(30) sё paku një herë në vit i drejtohet Kuvendit të Kosovës përkitazi me fushëveprimtarinë e 
tij/saj. 

Neni 85 
[Kualifikimi për Zgjedhjen e Presidentit] 

President i Republikës së Kosovës mund të zgjedhet çdo shtetas i Republikës së Kosovës, i cili e ka 
mbushur moshën tridhjetë e pesë (35) vjeçare. 

Neni 86 
[Zgjedhja e Presidentit] 

1. Presidenti i Republikës së Kosovës zgjedhet nga Kuvendi, me votim të fshehtë. 

2. Zgjedhja e Presidentit të Republikës së Kosovës duhet të bëhet jo më vonë se tridhjetë (30)  ditë para 
përfundimit të mandatit të Presidentit aktual. 

3. Secili shtetas i Republikës së Kosovës mund të nominoh et si kandidatë për President të  Republikës së 
Kosovës, nëse ajo/ai siguron nënshkrimet e të paktën tridhjetë (30) deputetëve  të Kuvendit të Kosovës. 
Deputetët e Kuvendit mund të nënshkruajnë vetëm për një kandidatë  për President të Republikës së 
Kosovës. 

4. Zgjedhja e Presidentit bëhet me dy të tretat (2/3) e votave të të gjithë deputetëve të Kuvendit. 

5. Nëse asnjëri kandidat nuk merr shumicën prej dy të tretave (2/3) në dy votimet e para,  organizohet 
votimi i tretë në mes të dy kandidatëve të cilët kan ë marrë numrin më të lartë të  votave në votimin e dytë
